import React from "react";
// import Navbar from "./Navbar"


const Home = () => {

    const [flavors, setFlavors] = React.useState([]);

    React.useEffect( () => {
        console.log("useeffect");
        fetchData();
    }, []);


    const fetchData = async () => {
        // const data = await fetch("https://api.npms.io/v2/search?q=react");
        const response = await fetch("/");
        const items = await response.json();

        console.log(items);

        setFlavors(items);
    };

    return (
        <div>
            <ul>
                {flavors.map(flavor => {
                    return <li>{flavor.package.name}</li>
                })}
            </ul>
        </div>
    );
}

export default Home;
